import {
  CONTACT_ACTION,
  FINANCIAL_ACTION,
  BUSINESS_ACTION,
} from "./actionTypes";

function submitContactAction(firstName, lastName, email) {
  return {
    type: CONTACT_ACTION,
    payload: {
      firstName: firstName,
      lastName: lastName,
      contactEmail: email,
    },
  };
}

const submitBusinessAction = (businessName, numEmployees, zip, industry) => {
  return {
    type: BUSINESS_ACTION,
    payload: {
      businessName: businessName,
      numEmployees: numEmployees,
      industry: industry,
      zip: zip,
    },
  };
};

const submitFinancialsAction = (grossAnnualSales, annualPayroll) => {
  return {
    type: FINANCIAL_ACTION,
    payload: {
      grossAnnualSales: grossAnnualSales,
      annualPayroll: annualPayroll,
    },
  };
};

const actions = {
  submitContactAction,
  submitBusinessAction,
  submitFinancialsAction,
};

export default actions;
